const Countries = ({countries, onClick}) => {

    const setCountry = (country) => {
        onClick(country)
    }

    return(<ul>
        {countries.map(country =>
            <p key={country.name}>{country.name}
                <button onClick={() => setCountry(country)} >show</button>
            </p>
            )}
    </ul>)
}

export default Countries;
